import React from 'react';
import ProductCard from './ProductCard';

const products = [
    { title: 'Product 1', price: 10, image: '/images/product1.jpg' },
    { title: 'Product 2', price: 20, image: '/images/product2.jpg' },
    { title: 'Product 3', price: 30, image: '/images/product3.jpg' },
];

const ProductList: React.FC = () => {
    return (
        <div className="product-list">
            {products.map((product, index) => (
                <ProductCard
                    key={index}
                    title={product.title}
                    price={product.price}
                    image={product.image}
                />
            ))}
        </div>
    );
};

export default ProductList;
